//import plugin
import React from 'react';
import { Link } from "react-router-dom";
import {store,actions} from '../store'
import {withRouter} from 'react-router-dom'
import {connect} from 'unistore/react'

//import style
import "../style/cart.css"
import Navbar from '../component/navbar';
import Category from '../component/navbarCategory'
import Search from '../component/search';
import ListAllProduct from '../component/listAllProduct'
import CartFromSeller from '../component/cartFromSeller';

// untuk mengembalikan respon saat tidak ditemukan page yang sesuai
class Cart extends React.Component{
    componentDidMount = async () => {
        console.warn("saya ada di sini kakak")
        await this.coba()
    }
    coba = async() => {
        await this.props.RequestDataAllProduct()
    }
    render(){
        console.log("ini di render")
        const listProduct1 = this.props.listProduct1;
        console.log("aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa",listProduct1)
        const TopProduct1 = listProduct1.filter(item1 => {
            if (item1.name_product1 !== null && item1.image !== null){
                console.log("aku true")
                return item1;
            }
            return false;
        });

        const ListProduk1 = TopProduct1.map((item1) => {
            return(
                <ListAllProduct
                id_produk1={item1.id}
                nama_produk1={item1.name_product}
                deskripsi_produk1={item1.description}
                rating_produk1={item1.rating}
                berat_produk1={item1.weight}
                harga_produk1={item1.price}
                bungkus_produk1={item1.reference}
                stock_produk1={item1.stock}
                halal_produk1={item1.halal}
                gambar_produk1={item1.image}
                />
            );
        });
        return(
            <nav>
                <Navbar/>
                <Search/>
                <div className="container-fluid cart-product">
                    <div className="row">
                        <div className="col-md-12 cart-direct">
                            <nav class="navbar navbar-expand-lg navbar-light bg-light" style={{paddingTop:"0",paddingLeft:"0",paddingBottom:"0",paddingRight:"0"}}>
                                <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent2" aria-controls="navbarSupportedContent2" aria-expanded="false" aria-label="Toggle navigation">
                                    <span class="navbar-toggler-icon"></span>
                                </button>

                                <div class="collapse navbar-collapse" id="navbarSupportedContent2" style={{backgroundColor:"white",paddingLeft:"64%"}}>
                                    <ul class="navbar-nav mr-auto">
                                        <li class="nav-item">
                                            <Link to="/cart" class="nav-link" style={{color:"#9ACD32", fontSize:"35px"}}>Cart</Link>
                                        </li>
                                        <li class="nav-item">
                                            <p class="nav-link" style={{fontSize:"35px",fontWeight:"1000"}}>&#62;</p>
                                        </li>
                                        <li class="nav-item">
                                            <Link to="/store" class="nav-link" style={{color:"#9ACD32",fontSize:"35px"}}>Checkout</Link>
                                        </li>
                                        <li class="nav-item">
                                            <p class="nav-link" style={{fontSize:"35px",fontWeight:"1000"}}>&#62;</p>
                                        </li>
                                        <li class="nav-item">
                                            <p class="nav-link" style={{fontSize:"35px"}}>Finish</p>
                                        </li>
                                    </ul>
                                </div>
                            </nav>
                        </div>
                        <CartFromSeller/>
                    </div>
                </div>
            </nav>
        )
    }
}

//mengeksport class NotMatch ke main-route.js
export default connect('', actions
)(withRouter(Cart));
